pragma solidity ^0.8.0;

import "./game.sol";

contract gamesAdmin {
    address  gamesManager ;
    constructor (){
        gamesManager = msg.sender;
    }

 //mapping to store the list of games
    game [] _gamesArray;

function createGame(string memory _gameType, string memory _gameTier,address payable _feeWallet) public {
    //require(msg.sender == campaignManager,"Only Admins can perform this operation");
    game _newGame =  new game(_gameType,_gameTier,_feeWallet);
    _gamesArray.push(_newGame);
}

function retrieveGames ()  public view returns (game[] memory) {
return _gamesArray;
}


}
